import { AUTHENTICATE_USER, SIGN_OUT } from "./types";

export const signOut = (id) => {
    return {
        type: SIGN_OUT,
        id
    };
}

export const authUser = (username) => {
    return {
        type: AUTH_USER,
        username
    };
}
